import React from 'react';
import Nav from './Nav';
import './kids.css';
import Kid from '../images/kids.png';
import Boy from '../images/s'

function Kids() {
  return (
    <div className='kids' >
        <Nav/>
        <div className='sec-1'>
          <div class="rainbow-letters">
          <span>K</span>
          <span>I</span>
          <span>D</span>
          <span>S </span>
          <span>P</span>
          <span>A</span>
          <span>G</span>
          <span>E</span>
            </div>
          <img className='kid-1' src={Kid} alt='child-sticker'/>

        </div><br/>
        <div className='sec-2'> 
          <div className='box-1'></div>
          <div className='box-1'></div>
          <div className='box-1'></div>
          <div className='box-1'></div>
          <div className='box-2'></div>
        </div><br/>



       
    </div>
  );
}

export default Kids;
